import React, { Component } from 'react';
import {
  Text,View,Button,TouchableOpacity
} from 'react-native';
import { styles } from './styles'; // 新しく作成したstyles.jsファイルをインポート




export default class Page1Screen extends Component {
  render() {
    return (
    
    
    //
    
    <View contentContainerStyle={styles.container}>

      <Text style={styles.currentTime}>現在: </Text>
    
    
    <TouchableOpacity onPress={() => {
      this.props.navigation.navigate('鹿児島発')
    }}>
    
    
      
        <Text style={styles.currentTime}>鹿児島発</Text>
      
    </TouchableOpacity>
    
    
    <TouchableOpacity onPress={() => {
      this.props.navigation.navigate('桜島港発')
    }}>
    
    
      
        <Text style={styles.currentTime}>桜島港発:</Text>
      
    </TouchableOpacity>
    
    
    
    
    </View>

    )
  }
}
